import React, {Component} from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import MyNavbar from './Navbar/navbar'
import MyJumbotron from './Jumbotron/jumbotron'

class App extends Component {
  state = {
    persons: [
      {name: 'jaems', age: 12},
      {name: 'jaesdfms', age: 122}
    ],
    jumbotron: true
  }

  hidJumbotronhandler = () => {
    this.setState({
      persons: [
        {name: 'jaems', age: 12},
        {name: 'jaesdfms', age: 122}
      ],
      jumbotron: !this.state.jumbotron
    })
  }

  render(){

    if (this.state.jumbotron){
      calendars = (
        <div>
          <Calendar next={this.toggleNextHandler} 
            prev={this.togglePrevHandler}
            test={this.state.calendar}
            numOfDays={this.state.numOfDays}
            monthN={this.state.monthN}
            calNum={this.state.monthBooking} />
        </div>
      );
    }


  return (
    <div>
      <MyNavbar/>
      <MyJumbotron click={this.hidJumbotronhandler}/>
    </div>
  );}
}

export default App;
